import requests
import json
from django.conf import settings
from tables.seeds.mappings.mappings import nb_zip


class StreetEasyAPI:

	def __init__(self, access_key):
		self.access_key = access_key
		self.format = 'json'

	def get(self, zip_code):
		URL = "http://streeteasy.com/nyc/api/rentals/data"
		params={
			"key": self.access_key,
			"format": self.format,
			"zip": zip_code,
		}
		print('got params', zip_code)
		return requests.get(URL, params=params)


api = StreetEasyAPI(settings.STREETEASY_KEY)

def get_zips(mapping, already_have):
	list_of_dicts = []
	for nb in mapping:
		print(nb)
		for zip_code in mapping[nb]:
			if zip_code == 'MISSING':
				continue
			if zip_code not in already_have:
				response = api.get(zip_code=zip_code)
				print('got RESPONSE', zip_code)
				list_of_dicts.append(response.text)
			else:
				print('ALREADY HAVE', zip_code)
	return list_of_dicts

